import "./IdCheck.css";

const IdCheck = () => {
    return (
        <div className="ID_CHECK">
            <input type="text" className="ID_INPUT" placeholder="아이디" />
            <button className="ID_BUTTON">중복확인</button>
        </div>
    );
}

export default IdCheck;
